COPY lu_education (pk, education) FROM stdin;
1	Diabetes mellitus is a disorder in which there is too much sugar in the blood. It is caused by a lack of an important hormone called insulin, which is made by a gland behind the stomach called the pancreas. Insulin controls the balance of sugar (glucose) in the body and allows the cells in the body to absorb the glucose from the bloodstream. Lack of insulin causes glucose to spill out from the blood through the kidneys into the urine. Type II diabetes is known as maturity-onset diabetes or non-insulin-dependent diabetes mellitus. It mainly affects people over 40, many of whom are overweight and have a diet with excess calories. They do not produce enough insulin to cope with the large supply of  glucose in their systems. It is usually controlled by a proper diet only, but sometimes tablets may have to be used. If diabetes is untreated, the complications are very severe and include coma (from either the blood sugar being too high or too low), kidney disease, blindness, heart disease and other problems caused by hardening of the arteries. The feet and eyes are at special risk and need special care and regular checks.
\.
